import "./App.css";
import Profile from "./Profile/Profile";

import users from "../../src/user.json";
const {
  username,
  tag,
  location,
  avatar,
  stats: { followers, views, likes },
} = users;

function App() {
  return (
    <div className="App">
      <Profile
        username={username}
        tag={tag}
        location={location}
        avatar={avatar}
        stats={stats}
      />
    </div>
  );
}

export default App;
